                <h1 id="introduction">Introduction</h1>
<p>The API documentation for Open Food Network Vine Platform.</p>
<aside>
    <strong>Base URL</strong>: <code>https://vine.openfoodnetwork.org.au</code>
</aside>
<p>This documentation aims to provide all the information you need to work with our API.</p>
<aside>As you scroll, you'll see code examples for working with the API in different programming languages in the dark area to the right (or as part of the content on mobile).
You can switch the language used with the tabs at the top right (or from the nav menu at the top left on mobile).</aside>

                <h1 id="authenticating-requests">Authenticating requests</h1>
<p>To authenticate requests, include an <strong><code>Authorization</code></strong> header with the value <strong><code>"Bearer {YOUR_API_TOKEN}"</code></strong>.</p>
<p>All authenticated endpoints are marked with a <code>requires authentication</code> badge in the documentation below.</p>
<h2 id="about-api-credentials">About API Credentials</h2>
<p>When you receive API credentials, they will be made up of a <code>token</code> and an accompanying <code>secret</code>. Your secret should never be displayed in front end code, or in any version control repositories, for security.</p>
<h2 id="signing-your-requests">Signing Your requests</h2>
<p>All API requests must be signed, to improve API security. To do this, you must generate a <a href="https://jwt.io/introduction">JWT</a> comprising your current request, signed with your API Token secret.</p>
<p>Send the JWT content in the <code>X-Authorization</code> header as follows</p>
<p>All JWTs must have the following claims:</p>
<ul>
<li>iat - <em>current timestamp, in UTC</em> - must not be less than a minute ago</li>
<li>exp - <em>expiry timestamp, in UTC</em> - must not be more than a minute later than iat claim</li>
<li>iss - <em>indicating issuer of the jwt</em></li>
</ul>
<h3 id="generating-a-jwt">Generating a JWT</h3>
<h4 id="php">PHP</h4>
<pre><code class="language-php">
use Lcobucci\JWT\Encoding\ChainedFormatter;
use Lcobucci\JWT\Encoding\JoseEncoder;
use Lcobucci\JWT\Signer\Hmac\Sha256;
use Lcobucci\JWT\Signer\Key\InMemory;
use Lcobucci\JWT\Token\Builder;

$tokenBuilder       = (new Builder(new JoseEncoder(), ChainedFormatter::default()));
$algorithm          = new Sha256();
$signingKey         = InMemory::plainText(YOUR_API_SECRET);
$now                = new \DateTimeImmutable();
$token              = $tokenBuilder
    -&gt;issuedBy(ISSUING_BODY)
    -&gt;issuedAt(now())
    -&gt;expiresAt(now()-&gt;addMinute(1))
    -&gt;getToken($algorithm, $signingKey);

$jwt = $token-&gt;toString();</code></pre>
<h4 id="ruby">Ruby</h4>
<pre><code class="language-ruby">require 'jwt'

# Your secret signing key (must be a strong secret)
signing_key = YOUR_API_SECRET

# Define the payload (the data you want to encode in the token)
payload = {
  iss: YOUR_ISSUING_BODY,       # Your issuer
  iat: Time.now.to_i            # Token issued at time (now)
  exp: Time.now.to_i + 60       # Token expiration time (1 minute from now)
}

# Choose the algorithm for signing (HS256 is common for symmetric signing keys)
algorithm = 'HS256'

# Generate the JWT
token = JWT.encode(payload, signing_key, algorithm)

puts "Generated JWT: #{token}"</code></pre>
